import React, { Col } from 'react';

const Currency = (props) => {
  return (
    <div className="d-inline-block col-3 border-bottom">
      <div className="border-bottom media py-3">
        <div className="media-body">{props.currency}</div>
        <div className="align-text-right">{props.proportion}%</div>
      </div>
    </div>
  );
};

export default Currency;
